class Solution(object):
    def uniqueXorTriplets(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        # pre-process
        xors = set()
        for num in nums:
            for num2 in nums:
                xors.add(num ^ num2)

        # process
        triplets = set()
        for num in nums:
            for xor in xors:
                triplets.add(num ^ xor)

        ans = len(triplets)
        return ans


